import { FETCH_PHOTO } from '../actions/types';

const initialState = {
    item: {}
}

export default function(state = initialState, action) {
    switch(action.type) {
        case FETCH_PHOTO:
            return {
                ...state,
                item: action.payload
            }
        default:
            return state;
    }
}
